import { Link ,NavLink} from "react-router-dom";
import Calendar from "./Calendar";


const Footer=()=>{
    return(
        <div className="text-white">
            <Link to='/'>
            <header className=" bg-indigo-600 w-80 text-white  relative " style={{height:"100vh" }}>
                    <nav className=" flex justify-between  flex-col">
                        <div className="mt-24">
                            <NavLink to="/"  className={({ isActive }) => (isActive ? "flex border-solid border-6 w-48 px-12 py-2 bg-slate-300 text-black " : "flex border-solid border-6 w-48 px-6 py-2  hover:bg-sky-700")}>Dashboard</NavLink>
                            <NavLink to="/Courses"  className={({ isActive }) => (isActive ? "flex border-solid border-6 w-48 px-12 py-2 bg-slate-300 text-black " : "flex border-solid border-6 w-48 px-6 py-2  hover:bg-sky-700")} >Courses</NavLink>
                        </div>
                        <div className="absolute bottom-0 left-0">
                         <Calendar/>
                        </div>
                    </nav>
             </header>
            </Link>
        </div>
    )
}


export default Footer;
